import AdminPageAddProduct from "../../Components/AdminPageAddProduct/AdminPageAddProduct";
import {useState} from 'react'

const AdminPage = () => {

  
  return (
    <div className="AdminPageWrapper">
      <AdminPageHeading toggleAddProductVisible={toggleAddProductVisible}/>
      {isAddProductVisible && <AdminPageAddProduct toggleAddProductVisible={toggleAddProductVisible}/>}
      <AdminProductList />
    </div>
  );
};

export default AdminPage;
